import React from 'react';
import { List, Header, Rating } from "semantic-ui-react";

export const Movies = ({ movies }) => {
    return (
        <List>
           {movies.map(movie => {
            return (
                <List.Item key={movie.title}>
                    <Header>{movie.title}</Header>
                    <Rating>{movie.rating}</Rating>
                </List.Item>
            )
        })} 
        </List>
    )
};
